import mixin from 'BlockChain-ui-privatization/PC/common-mixin/home/home/home';
import 'BlockChain-ui-privatization/PC/common-mixin/home/home/biki/biki.styl';
import SwiperVue from "../swiper/biki.vue";
import Market from "../market/international.vue";
import Recommend from "../recommend/international.vue";
import Custom from "../custom/biki.vue";
export default {
  mixins: [mixin],
  components: {
    Recommend: Recommend,
    Custom: Custom,
    Market: Market,
    SwiperVue: SwiperVue
  },
  mounted: function mounted() {
    var _this = this;

    this.onmessageWorker();
    this.getLundata(); // 监听 市场切换

    this.$bus.$on('SWITCH-MARKET', function (data) {
      _this.marketCurrent = data;

      _this.setMarketData();
    });
    this.$bus.$on('SWITCH-STORE', function (data) {
      _this.setMyMarket(data);

      _this.setMarketData();
    });
  },
  created: function created() {
    if (this.coinsKrwOpen === 1 && this.storeKrwFlag) {
      if (!localStorage.krwCheck) {
        this.krwFlag = true;
      }
    }
  },
  destroyed: function destroyed() {
    this.$bus.$off('SWITCH-STORE');
    this.$bus.$off('SWITCH-MARKET');
  },
  beforeDestroy: function beforeDestroy() {
    this.webSocketSend('Market', 'unsub', this.symbolCurrent, this.symbolList);
    window.onscroll = null;
  }
};
